<!DOCTYPE html>
<html lang="ru">
<head>
  <meta charset="UTF-8">
  <meta name="viewport" content="width=device-width, initial-scale=1">
  <meta name="robots" content="index, follow">
  <meta name="title" content="your life in weeks">
  <title>Your Life In Weeks</title>
  <link href="css/style.min.css" rel="stylesheet">
</head>
<body>


  <svg xmlns="http://www.w3.org/2000/svg" style="display:none">
    <symbol id="x-arrow" viewBox="0 0 106 16">
      <g stroke="#000080" stroke-width="2" stroke-linecap="round" transform="translate(1.000000, 1.000000)">
        <path d="M104,7 L95,14" id="Line"></path>
        <path d="M0,7 L104,7" id="Line"></path>
        <path d="M104,7 L94,0" id="Line"></path>
      </g>
    </symbol>
    <symbol id="y-arrow" viewBox="0 0 122 14">
      <g stroke="#000080" stroke-width="2" stroke-linecap="round" transform="translate(1.000000, 1.000000)">
        <path d="M0,7 L120,7" id="Line"></path>
        <path d="M0.5,6.5 L8,0" id="Line"></path>
        <path d="M0,7 L9,12" id="Line"></path>
      </g>
    </symbol>
  </svg>


  <main class="main">
    <h1 class="main__title">Your <span class="main__years">90</span>-Year Life in <span class="main__select">Weeks</span></h1>

    <form class="form" action="#" method="post">
      <div class="form__group form__group--sex">
        <span class="form__label">Sex</span>

        <div class="form__group-item">
          <input class="form__radio" name="sex" id="male" type="radio" value="Male">
          <label for="male">Male</label>
        </div>

        <div class="form__group-item">
          <input class="form__radio" name="sex" id="female" type="radio" value="Female">
          <label for="female">Female</label>
        </div>
      </div>

      <div class="form__group form__group--birthday">
        <label class="form__label" for="date">Birthday</label>
        <input class="form__date" name="date" id="date" type="text" placeholder="dd/mm/yyyy">
      </div>

      <div class="form__group form__group--country">
        <label class="form__label" for="country">Country of Birth</label>
        <select class="form__select" name="country" id="country">
          <option selected value disabled>Select country</option>
        </select>
      </div>
    </form>

    <section class="table">
      <h2 class="visuallyhidden">Table</h2>

      <div class="table__x-axis">
        <label class="table__label table__label--weeks">Week of the Year
          <svg class="table__image table__image--weeks" width="106" height="16">
            <use xmlns:xlink="http://www.w3.org/1999/xlink" xlink:href="#x-arrow"></use>
          </svg>
        </label>

        <ol class="table__markers table__markers--weeks">
          <li class="table__markers-item">1</li>
          <li class="table__markers-item">5</li>
          <li class="table__markers-item">10</li>
          <li class="table__markers-item">15</li>
          <li class="table__markers-item">20</li>
          <li class="table__markers-item">25</li>
          <li class="table__markers-item">30</li>
          <li class="table__markers-item">35</li>
          <li class="table__markers-item">40</li>
          <li class="table__markers-item">45</li>
          <li class="table__markers-item">50</li>
        </ol>
      </div>

      <div class="table__y-axis">
        <label class="table__label table__label--years">
          <svg class="table__image table__image--years" width="122" height="14">
            <use xmlns:xlink="http://www.w3.org/1999/xlink" xlink:href="#y-arrow"></use>
          </svg>
          Age
        </label>

        <ol class="table__markers table__markers--years">
          <li class="table__markers-item">0</li>
          <li class="table__markers-item">5</li>

          <li class="table__markers-item">15</li>
